import React from 'react';
import { Link } from 'react-router-dom';

class Header extends React.Component {
  render() {
    return (
      <header>
        <Link id="nome" to="/">Matheus Contassot</Link>
        <nav>
          <p>Sobre</p>
          <p>Projetos</p>
          <p>Contato</p>
        </nav>
      </header>
    );
  }
}

export default Header;
